import React from 'react';
import './MyInput.css'

function MyInput(props) {
  return (
    <div className="Div-my-input">
        <span onChange={props.onChange} className="Label">{props.label}</span>
        <input className="My-input" value={props.value}/>
    </div>
  );
}

export default MyInput;
